import React from 'react'
import styled from 'styled-components'

const Zumthor = () => {
    return (
        <Page>
            
            <Nav>
                <Logo>
                    Zumthor
                </Logo>
                <NavButton>
                    Entrar
                </NavButton>
            </Nav>
            
            <Main>
                <Title>
                    Zumthor
                </Title>
                <SubTitle>
                    Crie experiências espaciais para seus clientes e usuários com a ajuda da inteligência artifical.
                </SubTitle>
                <Actions>
                    <EnterButton>
                        Entrar
                    </EnterButton>
                    <SearchButton>
                        Ver projetos
                    </SearchButton>
                </Actions>
            </Main>  
                                    
        </Page>
    )
}

export default Zumthor

const Button = styled.button`
    max-width: 200px;
    width: 100%;
    height: 45px;

    background: #333;
    color: white;
    border: none;
    outline: none;
    cursor: pointer;

    display: flex;
    align-items: center;
    justify-content: center;

    transition: 0.5s;
    
    &:hover {
        background: #ccc;
    }
`

const Page = styled.div`
    width: 100vw;
    min-height: 100vh;
    display: flex;
    flex-direction: column;
    align-items: center;
`
const Nav = styled.div`
    max-width: 900px;
    width: 100%;
    height: 15vh;
    display: flex;
    align-items: center;
    justify-content: space-between;
`
const Logo = styled.h2``
const NavButton = styled(Button)`
    width: 100px;
`
const Main = styled.main`
    max-width: 900px;
    width: 100%;
    min-height: 85vh;
    display: flex;
    flex-direction: column;
    align-items: center;
    justify-content: center;
`
const Title = styled.h1`
    font-size: 72px;
    margin-bottom: 24px;
`
const SubTitle = styled.h2`
    font-size: 24px;
    text-align: center;
`
const Actions = styled.div`
    display: flex;
    max-width: 600px;
    width: 100%;
    align-items: center;
    justify-content: center;
`
const EnterButton = styled(Button)``
const SearchButton = styled(Button)``
